export default {
  name: 'GroupMember',
  props: {
    values: {
      type: Array,
      default: () => []
    }
  },
  methods: {
    MemberDelete(value) {
      this.$confirm(`此操作将${value.username}用户移出该成员组, 是否继续?`, '删除机房', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(() => {
        this.$emit('delete', value)
      }).catch(() => {
        this.$message({
          type: 'info',
          message: '已取消删除'
        })
      })
    }
  }
}
